import React from 'react';

const MyProfile = () => {
  const getDataHandeler = () => {
    fetch('https://pro-crew-52de7-default-rtdb.firebaseio.com/identety.json')
      .then((res) => res.json())
      .then((data) => console.log(`My Data Is ${data}`));
  };
  return (
    <section>
      <div>
        <button onClick={getDataHandeler}> Get Your Data</button>
      </div>
    </section>
  );
};

export default MyProfile;
